text:
let me be frank with you kevin spacey. thanks for pulling back the curtain and giving the world an inside look at how a serial abuser behaves. your depraved, narcissistic and bat-shit crazy video proves you are incapable of remorse and compassion for the men you victimized (many of whom were teenagers at the time). nobody misses you and nobody is hoping you make a "comeback." clearly you didn't get the memo that a long overdue reckoning is happening. the world called time's up on you last year and every day we're coming together to call time's up on people like you who commit heinous acts of abuse, assault and harassment against women, men and children. you've been cancelled kevin spacey and the only place you're a legend is in your own mind. 
for everyone who wants to help survivors seek justice, please consider making a donation to support the noble work @timesupnow 
